import axios from "axios";

export default function getPoke() {
  return function (dispatch) {
    axios.get("http://localhost:3001/api/pokemon").then((pokemons) => {
      dispatch({
        type: "GET_POKE",
        payload: pokemons.data,
      });
    });
  };
}
